      "definition" : {
        "text" : {
          "nb" : "person som passer andres barn regelmessig på dagtid, gjerne hele dager, og ofte mens foreldrene er på jobb. Passer som regel flere barn samtidig, enten hjemme hos seg selv eller hjemme hos ett av barna."
        },
        "remark" : {
          "nb" : "En dagmamma skal godkjennes av kommunen i henhold til \"Forskrift om miljørettet helsevern i barnehager og skoler m.v\" dersom: 1) Man får godtgjøring for regelmessig tilsyn med og omsorg for barn, 2) tilbyr ukentlig oppholdstid på mer enn ti timer og 3) antall barn som er tilstede samtidig, er tre eller flere (inkludert dagmammaens egne barn).\n\nEnten er foreldrene arbeidsgivere, eller dagmammaen er selvstendig næringsdrivende. Det er mange forenklede regler for dagmammajobb i forhold til andre arbeidsforhold. Bant annet skal det ikke betales arbeidsgiveravgift og dagmammaen trenger ikke nødvedigvis registrere seg som selvstedig næringsdrivende i Brønnøysundregistrene."
