          "nb" : "inntektsfradrag etter overgangsregel til en gitt fysisk person som i skattleggingsperioden har hatt kostnad ved sykdom større enn minstebeløpet, og i tillegg rettmessig har fått tilsvarende særfradrag for sykdom eller svakhet både i skattleggingsperioden 2010 og 2011"
        },
        "remark" : {
          "nb" : "Særfradrag for store sykdomsutgifter gis ikke for utgifter til følgende formål: tannlege- og tannpleierhjelp; påbygging, ombygging og tilpasning av bolig og uteområde, herunder fritidsbolig, garasje mv., og anskaffelse og montering av spesialtilpasset innredning i bolig mv.; transport, herunder anskaffelse av kjøretøy og spesialutstyr i kjøretøy, drift og merbruk av kjøretøy; sykdom eller annen svakhet anses normalt som varig dersom tilstanden har vart i minst to år eller må antas å vare i minst to år. Dette gjelder selv om den skattepliktige ble eller ville blitt frisk tidligere dersom han hadde fått behandling, eller om han dør før to år er gått. Fra og med skattleggingsperioden 2013 gis særfradrag med 67 prosent av fradragsberettigede kostnad ved sykdom større enn minstebeløpet. Personen kan ikke kreve både særfradrag for usedvanlig store kostnader ved sykdom og særfradrag for lettere og varig nedsatt ervervsevne."
        },
