      "definition" : {
        "text" : {
          "nb" : "avtale inngått individuelt mellom kunde som har fylt 18 år og pensjonsinnretning om pensjonssparing basert på lovmessige krav som gir kunden rett til inntektsfradrag innenfor lovbestemt maksimalgrense for premie, innskudd og vederlag for forvaltning og administrasjon av avtalen"
        },
        "remark" : {
          "nb" : "Ordning for skattefavorisert individuell sparing til pensjon har vært åpen for nytegning siden 01.11.2017 og erstatter ordningen med individuell pensjonsavtale (IPS). Innbetalinger til skattefavorisert individuell sparing til pensjon gir rett til inntektsfradrag opp til kr 40 000 per år. Innestående sparebeløp i ordningen skattlegges ikke som formue. Utbetalinger fra denne avtalen skattlegges som kapitalinntekt, men ikke som personinntekt.\n\nOrdningen for individuell pensjonsavtale (IPS) var åpen for nytegning fra og med 01.01.2008 til og med 31.10.2017, men de som har en eksisterende individuell pensjonsavtale (IPS) kan fortsette å spare på denne. Innbetalinger til individuell pensjonsavtale (IPS) etter lov 27.juni 2008 nr. 62 om individuell pensjonsordning gir rett til inntektsfradrag opp til kr 15 000 per år. Utbetalinger fra slik avtalen skattlegges som pensjonsinntekt , men uføreytelser fra ordningen skattlegges som lønnsinntekt. Engangsutbetaling til dødsbo skattlegges etter egen skattesats i stortingets skattevedtak. \n\nPerson som sparer i både IPS og ordning for skattefavorisert individuell sparing til pensjon får uansett ikke inntektsfradrag for mer enn kr 40 000 per år.\n\nOrdning for individuelle pensjonsavtaler etter skatteloven (IPA) var åpen for nytegning til og med 12.05.2006. Innestående sparebeløp for denne avtalen skattlegges ikke som formue, men eventuelt resterende premiefond er skattepliktig formue. Utbetalinger fra slik avtale skattlegges som pensjonsinntekt , men uføreytelser fra ordningen skattlegges som lønnsinntekt. Engangsutbetaling til dødsbo skattlegges etter egen skattesats i stortingets skattevedtak."
        },
        "source" : {
          "prefLabel" : {
            "nb" : "Lov om individuell pensjonsordning § 1-1 og skatteloven § 6-47 første ledd bokstav c og d, FSFIN § 6-47-1 - § 6-4-17"
          }
        },
