        "remark" : {
          "nb" : "Global skatteplikt til Svalbard oppstår:\n- For personer som før oppholdet på Svalbard har vært skattemessig bosatt i riket etter internlovgiving (herunder skattemessig bosatt på Svalbard) i løpet av de siste 10 årene, vil global skatteplikt oppstå fra første dag som skattemessig bosatt på Svalbard.\n- For personer som før oppholdet på Svalbard ikke har vært skattemessig bosatt i riket etter internlovgiving  (herunder skattemessig bosatt på Svalbard) i løpet av de siste 10 årene, vil global skatteplikt oppstå i år 6, med mindre skattekontoret har krevd global beskatning tidligere.\nSkatteplikten kan innskrenkes når skattyter har dokumentert beskatning av skattegrunnlag utenfor Svalbard"
