          "nb" : "minstefradraget er et standardisert fradrag i lønn, pensjon og likestilte inntekter for kostnader som er pådratt for å erverve, vedlikeholde eller sikre arbeidsinntekt og annen inntekt som omfattes av § 6-31, jf. sktl. §§ 6-30. Dersom de faktiske kostnadene er større enn minstefradraget, kan man i stedet kreve fradrag for de faktiske kostnadene i skattemeldingen. Minstefradraget beregnes automatisk når inntekten er innrapportert og ferdig utfylt i skattemeldingen. Minstefradraget har en øvre og nedre grense for hhv. arbeidsinntekt og pensjonsinntekt. Summen av minstefradraget i lønnsinntekt og minstefradraget i pensjonsinntekt begrenses oppad til øvre grense i minstefradraget i lønnsinntekt."
