      "definition" : {
        "text" : {
          "nb" : "korrigeringer (+/-) til alminnelig inntekt før særfradrag ved beregning av skattebegrensning - liten skatteevne. Ved skattebegrensning - liten skatteevne må det i de fleste tilfeller foretas korrigeringer som medfører at beregningsgrunnlaget blir et annet enn alminnelig inntekt, og ikke det samme som ved skattebegrensning ved lav alminnelig inntekt etter skatteloven § 17-1. Dette gjelder enten alminnelig inntekt er positiv eller negativ (underskudd). Som regel må det gjøres tillegg i beregningsgrunnlaget."
        },
        "sources" : [ ]
