      "altLabel" : [ ],
      "hiddenLabel" : [ ],
      "contactPoint" : {
        "email" : "begrepskatalogen@skatteetaten.no"
      },
      "example" : {
        "nb" : "Eksempel på tillegg i beregningsgrunnlaget er arv, gave, barnetrygd, kontantstøtte, skattefrie leieinntekter, lotterigevinster, stipendier og  inntekt tilhørende personer som deltar i skattyters husholdning (for eksempel samboer)  i den utstrekning disse har inntekt utover det som antas å medgå til eget underhold. Eksempel på fradrag som skal legges til beregningsgrunnlaget er gjeldsrenter for låneopptak til dekning av fritidseiendom, fritidsbåt, kostbar bolig og bil o.l., framførbart underskudd, særskilt fradrag for sjøfolk, fiskere, m.m. Eksemplene er ikke uttømmende. I mer sjeldne tilfeller skal det gjøres fradrag i beregningsgrunnlaget. For eksempel inntektsført beløp fra gevinst- og tapskonto vedrørende realisasjonsgevinster fra tidligere år, samt tilsvarende inntektsføring fra negative saldo mv."
      },
