          "nb" : "en ytelse som skal kompensere for bortfall av arbeidsinntekt for brukere som har omsorgen for et barn som på grunn av sykdom, skade eller lyte trenger kontinuerlig tilsyn og pleie i en periode, eller i forbindelse med pleie av en nærstående i livets sluttfase."
        },
        "remark" : {
          "nb" : "Pleiepenger gis til personer med omsorg for: \n- barn som er under 18 år, og barnet har en sykdom, skade eller lyte som fører til at barnet trenger kontinuerlig tilsyn og pleie. \n- barn med en utviklingshemning og som har en livstruende eller annen svært alvorlig sykdom eller skade, uten hensyn til aldersgrensen på 18 år. \n\nPleiepenger kan gis til en person i 60 dager, som i hjemmet pleier en nærstående i livets sluttfase."
        },
        "source" : {
